import './Pets.css';
import { Filter } from '../Filter/Filter'
import { Cards } from '../Cards/Cards'
import cats from '../../mocks/cats.json'
import axios from 'axios'

export const Pets = () => {

    return (
        <div className="container">
            <div className="app-container">
                <Filter />
                <Cards cats={cats} />
            </div>
        </div>
    )
}
